<script setup lang="ts">
import { ref, watchEffect } from "vue";

const props = defineProps({
  startX: { type: Number, default: 0 },
  startY: { type: Number, default: 200 },
  angle: { type: Number, default: 0 },
  active: { type: Boolean, default: false },
});

const isAnimating = ref(false);
const isWaving = ref(false);

watchEffect(() => {
  if (props.active) {
    if (isAnimating.value) {
      return;
    }
    isAnimating.value = true;
    setTimeout(() => {
      isAnimating.value = false;
    }, 1300);
  }
});

watchEffect(() => {
  if (props.active) {
    isWaving.value = true;
    setTimeout(() => {
      isWaving.value = false;
    }, 250);
  }
});
</script>

<template>
  <svg
    id="Layer_1"
    data-name="Layer 1"
    xmlns="http://www.w3.org/2000/svg"
    xmlns:xlink="http://www.w3.org/1999/xlink"
    :viewBox="`${startX} ${startY} 390 644`"
    :style="{ transform: `rotate(${props.angle}deg)` }"
    class="absolute z-10"
  >
    <g :class="isAnimating ? 'peek' : ''">
      <image
        width="122"
        height="187"
        transform="translate(245.78 331.51) scale(.44)"
        xlink:href="data:image/png;base64,"
      />
      <g class="klocka" :class="isWaving ? 'wiggle' : ''">
        <image
          width="132"
          height="123"
          transform="translate(218.78 316.18) scale(.41)"
          xlink:href="data:image/png;base64,"
        />
      </g>
    </g>
  </svg>
</template>

<style scoped>
.peek {
  animation: bounce 1.3s;
}
.wiggle {
  animation: rotate 0.25s;
  transform-origin: 64% 56%;
}

@keyframes bounce {
  0%,
  100% {
    transform: translateY(0);
  }

  50% {
    transform: translateY(-80px);
  }
}

@keyframes rotate {
  0%,
  100% {
    transform: rotate(0deg);
  }

  25% {
    transform: rotate(-90deg);
  }

  50% {
    transform: rotate(90deg);
  }

  75% {
    transform: rotate(0deg);
  }
}
</style>
